import React from 'react'

const Auth = props => {
    const enterPword = (e) => {
        e.preventDefault()
        console.log(e.value)
    }

    return (
        <div
            style={{
                height: '100vh',
                width: '100vw',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
            }}
        >
            <div>
                <div> Enter Password to access site</div>
                <form
                    onSubmit={(e) => enterPword(e)}
                >
                    <input 
                        type="password"
                        style={{
                            width: 200,
                            height: 30,
                            margin: 10,
                            borderRadius: 20,
                        }}
                    />

                    <input
                        type='submit'
                    />
                </form>
            </div>
        </div>
    )
}

export default Auth
